import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { fetchYouTubeData} from '../api/youtubeApi'
import {
  Box,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Typography,
  Accordion,
  AccordionSummary,
  AccordionDetails,
  Button,
  TextField,
  CircularProgress,
} from '@mui/material';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

const API_BASE = 'http://localhost:8000/youtube/';

const FetchDataForm = () => {
  const [channelUrl, setChannelUrl] = useState('');
  const [comments, setComments] = useState([]);
  const [videoData, setVideoData] = useState(null); // For storing video data
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);


  // insert data into backend
  const submitUrl = async () => {
    if (!channelUrl) {
      alert('Please enter a YouTube channel URL.');
      return;
    }

    setLoading(true);
    try {
      await fetchYouTubeData(channelUrl);
      alert('Data fetched successfully!');
    } catch (err) {
      alert('Error fetching data.');
    } finally {
      setLoading(false);
    }
  };


  const fetchComments = async () => {
    try {
      const response = await axios.get(`${API_BASE}comments/`);
      console.log('response ===<<<>>', response.data[0])
      if (response.status === 200) {
        setComments(response.data);
      } else {
        throw new Error('Failed to fetch comments.');
      }
    } catch (err) {
      console.error('Error fetching comments:', err);
      setError('Error fetching comments.');
    }
  };

  

  useEffect(() => {
    fetchComments();

  }, []);

  return (
    <Box sx={{ p: 3 }}>
      <Typography variant="h4" gutterBottom>
        YouTube Comments Fetcher
      </Typography>

      {/* Input for Channel URL */}
      <Box sx={{ mb: 2, display: 'flex', gap: 2 }}>
        <TextField
          label="YouTube Channel URL"
          variant="outlined"
          fullWidth
          value={channelUrl}
          onChange={(e) => setChannelUrl(e.target.value)}
        />
        <Button
          variant="contained"
          color="primary"
          onClick={submitUrl}
          disabled={loading}
        >
          {loading ? <CircularProgress size={24} /> : 'Submit YouTube Url'}
        </Button>
      </Box>

      {/* Display Video Data */}
      {console.log(JSON.stringify(videoData))}
     

      {/* Comments Table */}
      <TableContainer component={Paper} sx={{ mb: 3 }}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Comment ID</TableCell>
            <TableCell>Text</TableCell>
            <TableCell>Published Date</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
  {comments.length > 0 ? (
    comments.map((comment, index) => (
      <TableRow key={comment.comment_id || index}>
        <TableCell>{comment.comment_id}</TableCell>
        <TableCell>
          <div
            dangerouslySetInnerHTML={{
              __html: comment.text,
            }}
          />
        </TableCell>
        <TableCell>{new Date(comment.published_date).toLocaleString()}</TableCell>
      </TableRow>
    ))
  ) : (
    <TableRow>
      <TableCell colSpan={3}>No comments available</TableCell>
    </TableRow>
  )}
</TableBody>

      </Table>
    </TableContainer>

      {/* Button to Download Excel */}
      <Button
        variant="contained"
        color="secondary"
        onClick={handleDownloadExcel}
      >
        Download Comments as Excel
      </Button>
    </Box>
  );
};

export default FetchDataForm;
